import React from 'react';

const Input = (props) => {
    return ( 
    <div class="form-group">
        <label for={this.props.name}>{this.props.name}</label>
        <input 
        name={this.props.name} 
        onChange={this.props.onChange} 
        value={this.props.value} 
        id={this.props.value} 
        class="form-control"/>
    </div>
     );
}
 
export default Input;
